sources.styles/main.scss:
@mixin onTablet {
  @media (min-width: 768px) {
    @content;
  }
}
@mixin onDesktop {
  @media (min-width: 1200px) {
    @content;
  }
}
@mixin onLargeScreen {
  @media (min-width: 1440px) {
    @content;
  }
}

$black-color: #1c1a26;
$accent-color: #f9512e;
$grey-color: #7f8096;

* {
  box-sizing: border-box;
}

h1,
h2,
h3,
p {
  margin: 0;
}

.page {
  font-family: "Inter", sans-serif;
  font-style: normal;

  &__section {
    margin: 0 auto;
    max-width: 1440px;
    padding: 20px;
  }

  &__menu {
    margin: 0 auto;
    max-width: 1440px;
    padding: 20px;
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    transform: translateX(100%);
    transition: transform 0.3s;
    &:target {
      transform: translateX(0);
    }
  }

  &__body {
    background-color: #eef7ff;
    margin: 0;
  }
}

.header {
  width: 100%;
  height: 100vh;
  background-size: auto;
  background-position: center;
  background-repeat: no-repeat;
  background-image: url(../images/Cookie.png);
  display: block;
  &__top {
    display: flex;
    justify-content: space-between;
  }
  &__menu {
    @include onDesktop {
      display: none;
    }
  }
  &__content {
    padding: 144px 0 112px;
  }
  &__description {
    font-weight: 400;
    font-size: 16px;
    line-height: 24px;
    letter-spacing: -0.01em;
    color: $black-color;
    margin-bottom: 24px;
    text-align: center;
    @include onTablet {
      text-align-last: left;
    }
  }
  &__title {
    font-weight: 400;
    font-size: 64px;
    line-height: 54px;
    text-align: center;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    margin-bottom: 64px;
    @include onTablet {
      font-size: 80px;
      line-height: 68px;
      white-space: nowrap;
    }
    @include onDesktop {
      font-size: 144px;
      line-height: 122px;
    }
  }
  &__box-but {
    display: flex;
    justify-content: center;
    @include onDesktop {
      display: block;
    }
  }
  &__button {
    display: flex;
    justify-content: center;
    align-items: center;
    width: 280px;
    height: 56px;
    border: 2px solid $accent-color;
    border-radius: 32px;
    color: $accent-color;
    font-weight: 500;
    font-size: 16px;
    line-height: 16px;
    letter-spacing: 0.02em;
    text-transform: uppercase;
    text-decoration: none;
    text-align: center;
    &::before {
      display: inline-block;
      content: "";
      background-image: url(../images/icon.png);
      background-size: auto;
      background-repeat: no-repeat;
      height: 24px;
      width: 24px;
      margin-right: 6px;
    }
    &:hover {
      background-color: $accent-color;
      color: #fff;
      &::before {
        background-image: url(../images/Icon-hover.png);
      }
    }
  }
}

.logo {
  width: 136px;
  height: 32px;
}

.nav {

  display: none;
  @include onDesktop {
    display: flex;
    gap: 64px;
  }
  &__list {
    list-style: none;
    display: flex;
    gap: 64px;
  }
  &__link {
    text-decoration: none;
    color: $black-color;
    transition: color 0.3s;
    &:hover {
      color: $accent-color;
    }
  }
  &__call {
    &-img {
      height: 24px;
      margin-right: 4px;
    }
    display: flex;
    align-items: center;
    text-decoration: none;
    color: $accent-color;
    text-transform: uppercase;
  }
}

.menu {
  height: 100vh;
  background-color: #eef7ff;
  &__content {
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
  }
  &__top {
    display: flex;
    justify-content: space-between;
  }
  &__list {
    list-style: none;
    display: flex;
    flex-direction: column;
    gap: 24px;
  }
  &__link {
    text-decoration: none;
    color: $black-color;
  }
  &__call {
    text-decoration: none;
    color: $accent-color;
    text-transform: uppercase;
  }
}

.products {
  &__card {
    margin-bottom: 80px;
    max-width: 288px;

    @include onTablet {
      max-width: 100%;
    }
  }
  &__img {
    margin-bottom: 16px;
    width: 100%;
    object-fit: cover;
    object-position: center;
  }
  &__title {
    font-weight: 400;
    font-size: 72px;
    line-height: 62px;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    color: $black-color;
    margin-bottom: 24px;
  }

  &__subtitle {
    font-weight: 400;
    font-size: 16px;
    line-height: 24px;
    letter-spacing: -0.01em;
    margin-bottom: 80px;
  }
  &__name {
    font-weight: 500;
    font-size: 16px;
    line-height: 16px;
    letter-spacing: 0.02em;
    text-transform: uppercase;
    color: $grey-color;
    margin-bottom: 8px;
  }
  &__description {
    font-weight: 400;
    font-size: 16px;
    line-height: 24px;
    letter-spacing: -0.01em;
    margin-bottom: 16px;
  }
  &__link {
    color: $accent-color;
    text-decoration: none;
    text-transform: uppercase;
    &::before {
      display: inline-block;
      content: "";
      background-image: url(../images/Icon-arrow.png);
      background-size: auto;
      background-repeat: no-repeat;
      height: 24px;
      width: 24px;
      margin-right: 8px;
    }
  }
}

.grid {
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  gap: 16px;
  @include onTablet {
    grid-template-columns: repeat(8, 1fr);
    gap: 24px;
  }
  @include onDesktop {
    grid-template-columns: repeat(8, 1fr);
    gap: 24px;
  }
  @include onLargeScreen {
    grid-template-columns: repeat(8, 1fr);
    gap: 24px;
  }
  &__item {
    @for $start from 1 through 2 {
      @for $end from $start through 2 {
        &--mobie-#{$start}-#{$end} {
          grid-column: #{$start}/#{$end+1};
        }
      }
    }

    @for $start from 1 through 8 {
      @for $end from $start through 8 {
        &--tablet-#{$start}-#{$end} {
          @include onTablet {
            grid-column: #{$start}/#{$end+1};
          }
        }
      }
    }

    @for $start from 1 through 8 {
      @for $end from $start through 8 {
        &--desktop-#{$start}-#{$end} {
          @include onDesktop {
            grid-column: #{$start}/#{$end+1};
          }
        }
      }
    }

    @for $start from 1 through 8 {
      @for $end from $start through 8 {
        &--largeScreen-#{$start}-#{$end} {
          @include onLargeScreen {
            grid-column: #{$start}/#{$end+1};
          }
        }
      }
    }
  }
}

.about {
  width: 100%;
  height: 100vh;
  background-image: url(../images/Crumbs.png);
  background-position: center;
  background-repeat: no-repeat;
  &__title {
    font-weight: 400;
    font-size: 72px;
    line-height: 62px;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    color: $black-color;
    margin-bottom: 144px;
  }
  &__number {
    font-weight: 400;
    font-size: 96px;
    line-height: 82px;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    color: $black-color;
  }

  &__name {
    font-weight: 400;
    font-size: 16px;
    line-height: 24px;
    letter-spacing: -0.01em;
    color: $grey-color;
  }
}

.footer {
  &__container {
    padding: 88px 44px;
    height: 526px;
    background-color: $black-color;
  }
  &__title {
    font-weight: 400;
    font-size: 72px;
    line-height: 62px;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    color: #fff;
    margin-bottom: 40px;
  }
  &__menu {
    padding: 0;
    display: block;
  }

  &__item {
    list-style: none;
    margin-bottom: 16px;
    &--first {
      color: $grey-color;
      font-weight: 500;
      font-size: 16px;
      line-height: 16px;
      letter-spacing: 0.02em;
      text-transform: uppercase;
    }
  }
  &__link {
    color: #fff;
    text-decoration: none;
    font-weight: 400;
    font-size: 16px;
    line-height: 24px;
    letter-spacing: -0.01em;
  }
  &__socials {
    display: flex;
    gap: 32px;
  }
  &__copyright {
    font-weight: 400;
    font-size: 16px;
    line-height: 24px;
    letter-spacing: -0.01em;
    color: $grey-color;
  }
}
